import React from "react";
import Header from './Header';
import Note from './Note';
import Footer from './Footer';
import notes from '../notes';

function createNotes(noteItems) {
    return <Note 
    title={noteItems.title}
    content={noteItems.content}
/>;
}

function App() {
    return <div>
        <Header />
        
        <Footer />
    </div>
}
export default App;
